import {View, ScrollView, FlatList} from 'react-native';
import React, {useState, useEffect } from 'react';
import { Container, Text, Button } from 'native-base';
import GeneralStatusBarColor from '../../components/GeneralStatusBarColor';
import AsyncStorage from "@react-native-community/async-storage";
import axios from 'axios';

const Qc = ({navigation}) => {
  useEffect(() => {
    mesin()
    session()
  })

  const [value, setValue] = useState('value');
  const [sys_plant_id, setSys_plant_id]   = useState("");
  const [data, setData] = useState([])

  const mesin = async () => {
    const token = await AsyncStorage.getItem("key")
    const headers = {
      'Authorization': token
    }
    axios.get('http://139.255.26.194:3003/api/v1/qcs?tbl=daily_inspection&kind=machine&sys_plant_id=2', {headers: headers})
    .then(response => {
      setData(response.data.data)
    })
    .catch(error => console.log(error))
  }
  
  const session = async () => {
    try {
      const UserSession = await AsyncStorage.multiGet(['user', 'name', 'department_name', 'sys_plant_id', 'duty_plant_option_select'])
    } catch (error) {
      console.log('Multi Get Error: ', error.message)
    }
  }
    const handleGoTo = screen => {
		navigation.navigate(screen)
  }

  const machines = []
  data.forEach(element => {
    machines.push(
      <View style={{flexDirection: 'column', backgroundColor:'green'}}>
        <Button key={element.id} style={{marginTop: 5, marginLeft: 5, alignItems: 'center', justifyContent: 'center', width: "33%", borderRadius: 15}}>
          <Text style={{fontSize: 11}}>{element.code}</Text>
        </Button>
      </View>
    )
  });

  return (
    <Container>
      <View>
        <GeneralStatusBarColor backgroundColor="#54c3f0" barStyle="light-content"/>
      </View>
      <View style={{height: 100, backgroundColor: '#F0FFF0'}}>
        <View style={{paddingTop: 10, justifyContent: 'center', alignItems: 'center'}}>
          <Text>PLANT</Text>
        </View>
        <View style={{flex: 1, justifyContent: 'center', alignItems: 'center'}}>
          <View style={{borderWidth: 0.5, width: 150, height: 25, justifyContent: 'center', paddingLeft: 30}}>
            <SelectPicker onValueChange={(value) => console.warn(value)} 
              items={[
                {label: "PT TSSI PINANG", value: 2},
                {label: "PT TECHNO", value: 5}
              ]}
            />
          </View>
        </View>
      </View>
      <View style={{flex: 1, backgroundColor: '#dfe0df'}}>
        <ScrollView>
          {machines}
        </ScrollView>
      </View>
      <View style={{height: 60, backgroundColor: '#dfe0df', flexDirection: 'row', borderWidth: 0.3}}>
        <Button style={{height: 63, backgroundColor: '#dfe0df', justifyContent: 'center', alignItems: 'center', flex: 1}}>
          {/* <Icon style={{fontSize: 30, color: "black"}}
            name = "rowing"
          /> */}
          <Text style={{color: 'black'}}>Machines</Text>
        </Button>
        <Button style = {{height: 63, backgroundColor: '#dfe0df', justifyContent: 'center', alignItems: 'center', flex: 1}}>
          {/* <Icon style={{fontSize: 30, color: "black"}}
            name = "person"
          /> */}
          <Text style={{color: 'black'}}>Profile</Text>
        </Button>
      </View>
    </Container>
  )
}

export default Qc
